import {useState} from "react";


const useTags =() => {
    const [_tags, _setTags] = useState<string[]>(['餐饮','房租','服装','娱乐','旅行','美容','汽车','饮品','宠物','购物','度假','医疗']);
    const [tags, setTags] = useState<{ id:number;name:string }>([
        {id:1,name:'餐饮'},
        {id:2,name:'房租'},
        {id:3,name:'服装'},
        {id:4,name:'娱乐'},
        {id:5,name:'旅行'},
        {id:6,name:'美容'},
        {id:7,name:'汽车'},
        {id:8,name:'饮品'},
        {id:9,name:'宠物'},
        {id:10,name:'购物'},
        {id:11,name:'度假'},
        {id:12,name:'医疗'},
        ]);
    const iconMap:{[k:string]:string} ={
        '餐饮':'餐饮',
        '房租':'房租',
        '服装':'服装',
        '娱乐':'娱乐',
        '旅行':'旅行',
        '美容':'美容',
        '汽车':'汽车',
        '饮品':'饮品',
        '宠物':'宠物',
        '购物':'购物',
        '度假':'度假',
        '医疗':'医疗'};
    return{tags,setTags,iconMap}
}
export {useTags};
